1	Basics	02:00:00	<h2>Python Indentation</h2><p>Indentation refers to the spaces at the beginning of a code line.</p><p>Where in other programming languages the indentation in code is for readability only, the indentation in Python is very important.</p><p>Python uses indentation to indicate a block of code.</p><pre class="ql-syntax" spellcheck="false">if&nbsp;5&nbsp;&gt;&nbsp;2:\n&nbsp;&nbsp;print("Five is greater than two!")\n</pre><p>Python will give you an error if you skip the indentation:</p><h3>Example</h3><p>Syntax Error:</p><pre class="ql-syntax" spellcheck="false">if&nbsp;5&nbsp;&gt;&nbsp;2:\nprint("Five is greater than two!")\n</pre><p>The number of spaces is up to you as a programmer, the most common use is four, but it has to be at least one.</p><h3>Example</h3><pre class="ql-syntax" spellcheck="false">if&nbsp;5&nbsp;&gt;&nbsp;2:\n&nbsp;print("Five is greater than two!")&nbsp;\nif&nbsp;5&nbsp;&gt;&nbsp;2:\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;print("Five is greater than two!")&nbsp;\n</pre><p>You have to use the same number of spaces in the same block of code, otherwise Python will give you an error:</p><h3>Example</h3><p>Syntax Error:</p><pre class="ql-syntax" spellcheck="false">if&nbsp;5&nbsp;&gt;&nbsp;2:\n&nbsp;print("Five is greater than two!")\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;print("Five is greater than two!")\n</pre><h2>Python Variables</h2><p>In Python, variables are created when you assign a value to it:</p><h3>Example</h3><p>Variables in Python:</p><pre class="ql-syntax" spellcheck="false">x =&nbsp;5\ny =&nbsp;"Hello, World!"\n</pre><p>Python has no command for declaring a variable.</p>	1
\.


